import React from 'react';
import quenaImage from './images/quena.jpg';
import bomboImage from './images/bombo.jpg';
import charangoImage from './images/charango.jpg';
import './History.css';

const History = () => {
    return (
        <div className="history">
            <h2>Historia de Instrumentos</h2>
            <div className="instrument-history">
                <img src={quenaImage} alt="Quena" className="instrument-image" />
                <p>La quena es una flauta andina utilizada tradicionalmente en la música de los Andes.</p>
            </div>
            <div className="instrument-history">
                <img src={bomboImage} alt="Bombo" className="instrument-image" />
                <p>El bombo es un tambor grande utilizado en la música folklórica de la región andina.</p>
            </div>
            <div className="instrument-history">
                <img src={charangoImage} alt="Charango" className="instrument-image" />
                <p>El charango es un instrumento de cuerda típico de la región andina, similar a una pequeña guitarra.</p>
            </div>
        </div>
    );
};

export default History;
